/* 32 Teams participating in the World Cup */
CREATE TABLE IF NOT EXISTS public.teams
(
    id bigserial NOT NULL,
    short_name varchar(3) NOT NULL,
    long_name varchar(50) NOT NULL,
    fifa_ranking numeric NOT NULL,
    overall_rating FLOAT NOT NULL,
    att FLOAT,
    mid FLOAT,
    def FLOAT,
    squad_rating FLOAT,
    PRIMARY KEY (id)
);


/* 11 russian cities */
CREATE TABLE IF NOT EXISTS public.cities
(
    id bigserial NOT NULL,
    city_name varchar(280) NOT NULL,
    PRIMARY KEY (id)
);

/* 12 Stadiums */
CREATE TABLE IF NOT EXISTS public.stadiums
(
    id bigserial NOT NULL,
    stadium_name varchar(180) NOT NULL,
    city_id  bigserial NOT NULL,
    capacity FLOAT,
    construction_cost FLOAT,
    round8_indi INTEGER,
    final_indi INTEGER,
    PRIMARY KEY (id),
    FOREIGN KEY (city_id) REFERENCES public.cities(id)
);

/* 48 Group Games */
CREATE TABLE IF NOT EXISTS public.group_fixtures
(
    id bigserial NOT NULL,
    date date not null,
    stadium_id bigserial NOT NULL,
    PRIMARY KEY (id),
    FOREIGN KEY (stadium_id) REFERENCES public.stadiums(id)
);


/* 96 group team results, 2 teams per fixture */  
CREATE TABLE IF NOT EXISTS public.group_team_results
(
    id bigserial NOT NULL,
    fixture_id bigserial NOT NULL,
   	team_id bigserial NOT NULL,
    goals_for numeric,
    goals_against numeric,
    points numeric,
    PRIMARY KEY (id),
    FOREIGN KEY (fixture_id) REFERENCES public.group_fixtures(id), 
    FOREIGN KEY (team_id) REFERENCES public.teams(id)
);

/* name of groups */
CREATE TABLE IF NOT EXISTS public.groups
(
    id bigserial NOT NULL,
    name varchar(50),
    PRIMARY KEY (id)
);


/* 8 Groups */
CREATE TABLE IF NOT EXISTS public.group_teams
(
    id bigserial NOT NULL,
    group_id bigserial NOT NULL,
    team_id bigserial NOT NULL,
    pld integer,
    w integer,
    d integer,
    l integer,
    gf integer,
    ga integer,
    gd integer,
    pts integer,
    PRIMARY KEY (id),
    FOREIGN KEY (group_id) REFERENCES public.groups(id),
    FOREIGN KEY (team_id) REFERENCES public.teams(id)
);

/* over 700 Players */

CREATE TABLE IF NOT EXISTS public.squads
(
    id bigserial NOT NULL,
    team_id bigserial NOT NULL,
    player_name varchar(180),
    country varchar(50),
    position varchar(5),
    age integer, 
    caps integer, 
    goals integer,
    overall numeric, 
    potential numeric, 
    eur_value numeric, 
    eur_wage numeric,
    PRIMARY KEY (id),
    FOREIGN KEY (team_id) REFERENCES public.teams(id)
);


/* Cold & Rainy Weather */
CREATE TABLE IF NOT EXISTS public.weather
(
    id bigserial NOT NULL,
    city_id bigserial NOT NULL,
    date date NOT NULL,
    min_temperature FLOAT,
    rain_probability FLOAT,
    severe_indicator INTEGER,
    PRIMARY KEY (id),
    FOREIGN KEY (city_id) REFERENCES public.cities(id)
);


/* HISTORIC MATCHES */
CREATE TABLE IF NOT EXISTS public.historic_matches
(
    id bigserial NOT NULL,
    date date not null,
    cup_name varchar(280),
    PRIMARY KEY (id)
);

/* HISTORICS GOALS BY TEAM */
CREATE TABLE IF NOT EXISTS public.historic_team_results
(
    id bigserial NOT NULL,
    historic_match_id bigserial NOT NULL,
    team_id bigserial NOT NULL,
    goals float,
    PRIMARY KEY (id),
    FOREIGN KEY (historic_match_id) REFERENCES public.historic_matches(id),
    FOREIGN KEY (team_id) REFERENCES public.teams(id)
);

